/**
 * 判断是否是url
 * @param {*} message 
 * @returns 
 */
function isUrl(message) {
  return message.match(/https:\/\/[A-Za-z0-9\-\._~:\/\?#\[\]@!$&'\*\+,%;\=]*/);
}